import styled from "styled-components";

export const Button = styled.button `
    display: flex;
    justify-content: center;
    align-items: center;
    color: white;
    background-color: #272D48;
    border-radius: 10px;
    border: none;
    width: 37%;
    height: 12%;
    font-size: 2em;
    margin: 15px 0px;
    
`;
